mutation IndexAction ($input: IndexActionInput!) {
    indexAction(input: $input) {
        action {
            id
            cdgId
            billId                    
        }                  
    }
}

mutation IndexBill ($input: IndexBillInput!) 
{
    indexBill(input: $input) {
        bill {
          id
          cdgId
          url      
        }
    }
}
